import { Pool } from 'pg';
import jacs from 'jacsnpm'; const pool = new Pool({ connectionString: process.env.DATABASE_URL
}); class JacsDocumentStore { constructor(configPath) { this.configPath = configPath; } async initialize() { await jacs.load(this.configPath); } async createAndStore(content, options = {}) { // Create JACS document const docString = await jacs.createDocument( JSON.stringify(content), options.customSchema ); const doc = JSON.parse(docString); // Store in database const result = await pool.query(` INSERT INTO jacs_documents (id, version_id, document, agent_id, document_type) VALUES ($1, $2, $3, $4, $5) RETURNING * `, [ doc.jacsId, doc.jacsVersion, doc, doc.jacsSignature?.agentID, content.type || 'document' ]); return result.rows[0]; } async getDocument(id, versionId = null) { let query = 'SELECT * FROM jacs_documents WHERE id = $1'; const params = [id]; if (versionId) { query += ' AND version_id = $2'; params.push(versionId); } else { query += ' ORDER BY created_at DESC LIMIT 1'; } const result = await pool.query(query, params); return result.rows[0]; } async verifyDocument(id) { const row = await this.getDocument(id); if (!row) return null; const isValid = await jacs.verifyDocument(JSON.stringify(row.document)); // Update signature_valid flag await pool.query( 'UPDATE jacs_documents SET signature_valid = $1 WHERE id = $2 AND version_id = $3', [isValid, row.id, row.version_id] ); return { document: row.document, isValid }; } async searchDocuments(query) { const result = await pool.query(` SELECT * FROM jacs_documents WHERE document @> $1 ORDER BY created_at DESC `, [JSON.stringify(query)]); return result.rows; }
} // Usage
const store = new JacsDocumentStore('./jacs.config.json');
await store.initialize(); // Create and store a document
const doc = await store.createAndStore({ type: 'invoice', amount: 1500, customer: 'Acme Corp'
}); // Search documents
const invoices = await store.searchDocuments({ type: 'invoice' });

