import jacs from 'jacsnpm'; class SqliteJacsStore { constructor(dbPath) { this.db = new Database(dbPath); this.initSchema(); } initSchema() { this.db.exec(` CREATE TABLE IF NOT EXISTS jacs_documents ( id TEXT NOT NULL, version_id TEXT NOT NULL, document TEXT NOT NULL, agent_id TEXT, document_type TEXT, signature_valid INTEGER DEFAULT 1, created_at TEXT DEFAULT CURRENT_TIMESTAMP, PRIMARY KEY (id, version_id) ); CREATE INDEX IF NOT EXISTS idx_agent ON jacs_documents(agent_id); CREATE INDEX IF NOT EXISTS idx_type ON jacs_documents(document_type); `); } async initialize(configPath) { await jacs.load(configPath); } async createAndStore(content, options = {}) { const docString = await jacs.createDocument( JSON.stringify(content), options.customSchema ); const doc = JSON.parse(docString); const stmt = this.db.prepare(` INSERT INTO jacs_documents (id, version_id, document, agent_id, document_type) VALUES (?, ?, ?, ?, ?) `); stmt.run( doc.jacsId, doc.jacsVersion, docString, doc.jacsSignature?.agentID, content.type || 'document' ); return doc; } getDocument(id, versionId = null) { let query = 'SELECT * FROM jacs_documents WHERE id = ?'; const params = [id]; if (versionId) { query += ' AND version_id = ?'; params.push(versionId); } else { query += ' ORDER BY created_at DESC LIMIT 1'; } const stmt = this.db.prepare(query); const row = stmt.get(...params); if (row) { row.document = JSON.parse(row.document); } return row; } searchByType(documentType) { const stmt = this.db.prepare( 'SELECT * FROM jacs_documents WHERE document_type = ? ORDER BY created_at DESC' ); return stmt.all(documentType).map(row => ({ ...row, document: JSON.parse(row.document) })); }
}

