Use Redis for high-speed document access: import Redis from 'ioredis';
import jacs from 'jacsnpm'; class JacsRedisCache { constructor(redisUrl) { this.redis = new Redis(redisUrl); this.ttl = 3600; // 1 hour default TTL } async initialize(configPath) { await jacs.load(configPath); } async cacheDocument(docString) { const doc = JSON.parse(docString); const key = `jacs:${doc.jacsId}:${doc.jacsVersion}`; await this.redis.setex(key, this.ttl, docString); // Also cache as latest version await this.redis.setex(`jacs:${doc.jacsId}:latest`, this.ttl, docString); return doc; } async getDocument(jacsId, versionId = 'latest') { const key = `jacs:${jacsId}:${versionId}`; const docString = await this.redis.get(key); if (!docString) return null; return JSON.parse(docString); } async invalidate(jacsId, versionId = null) { if (versionId) { await this.redis.del(`jacs:${jacsId}:${versionId}`); } else { // Invalidate all versions const keys = await this.redis.keys(`jacs:${jacsId}:*`); if (keys.length > 0) { await this.redis.del(...keys); } } }
}

