import { JacsAgent } from 'jacsnpm';
import fs from 'fs'; class ContractSigningSystem { constructor() { this.agents = new Map(); } async registerAgent(name, configPath) { const agent = new JacsAgent(); await agent.load(configPath); this.agents.set(name, { agent, configPath }); return agent; } async createContract(content, sellerName) { const seller = this.agents.get(sellerName); if (!seller) throw new Error(`Agent ${sellerName} not found`); // Create and sign the contract const signedContract = await seller.agent.createDocument( JSON.stringify(content) ); return JSON.parse(signedContract); } async createAgreement(contract, agentNames, question) { const firstAgent = this.agents.get(agentNames[0]); if (!firstAgent) throw new Error(`Agent ${agentNames[0]} not found`); // Get agent IDs const agentIds = []; for (const name of agentNames) { const agent = this.agents.get(name); if (!agent) throw new Error(`Agent ${name} not found`); // Get agent ID from config const config = JSON.parse(fs.readFileSync(agent.configPath, 'utf-8')); agentIds.push(config.jacs_agent_id_and_version.split(':')[0]); } const agreementDoc = await firstAgent.agent.createAgreement( JSON.stringify(contract), agentIds, question, 'Legal contract requiring signatures from all parties' ); return JSON.parse(agreementDoc); } async signAgreement(agreement, agentName) { const agent = this.agents.get(agentName); if (!agent) throw new Error(`Agent ${agentName} not found`); const signedDoc = await agent.agent.signAgreement( JSON.stringify(agreement) ); return JSON.parse(signedDoc); } async checkAgreementStatus(agreement, agentName) { const agent = this.agents.get(agentName); if (!agent) throw new Error(`Agent ${agentName} not found`); const statusJson = await agent.agent.checkAgreement( JSON.stringify(agreement) ); return JSON.parse(statusJson); }
