Notify external systems when documents are signed. // webhook-notifier.js
import { JacsAgent } from 'jacsnpm';
import express from 'express';
import { JACSExpressMiddleware } from 'jacsnpm/http'; const app = express();
const PORT = 3000; // Initialize JACS
const agent = new JacsAgent();
await agent.load('./jacs.config.json'); // Webhook configuration
const webhooks = new Map(); // Register a webhook
app.post('/webhooks', express.json(), (req, res) => { const { url, events, secret } = req.body; const webhookId = crypto.randomUUID(); webhooks.set(webhookId, { url, events, secret, active: true }); res.json({ webhookId, message: 'Webhook registered' });
}); // JACS-protected document endpoints
app.use('/api', express.text({ type: '*/*' }));
app.use('/api', JACSExpressMiddleware({ configPath: './jacs.config.json'
})); app.post('/api/documents', async (req, res) => { if (!req.jacsPayload) { return res.status(400).send({ error: 'Invalid JACS request' }); } // Create document const signedDoc = await agent.createDocument( JSON.stringify(req.jacsPayload) ); const doc = JSON.parse(signedDoc); // Notify webhooks await notifyWebhooks('document.created', { documentId: doc.jacsId, version: doc.jacsVersion, timestamp: new Date().toISOString() }); res.send({ success: true, documentId: doc.jacsId });
}); async function notifyWebhooks(event, payload) { for (const [id, webhook] of webhooks) { if (!webhook.active) continue; if (!webhook.events.includes(event) && !webhook.events.includes('*')) continue; try { // Sign the webhook payload with JACS const signedPayload = await agent.signRequest({ event, payload, timestamp: new Date().toISOString(), webhookId: id }); // Send webhook const response = await fetch(webhook.url, { method: 'POST', headers: { 'Content-Type': 'text/plain', 'X-JACS-Signature': 'v1', 'X-Webhook-Secret': webhook.secret }, body: signedPayload }); if (!response.ok) { console.error(`Webhook ${id} failed: ${response.status}`); } } catch (error) { console.error(`Webhook ${id} error:`, error.message); } }
} app.listen(PORT, () => { console.log(`Webhook notification server running on port ${PORT}`);
});

